import React from 'react';
import "./index.css";
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import IconButton from '@material-ui/core/IconButton';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff'
import { Button } from '@material-ui/core';
import Select from '@material-ui/core/Select';
import InputLabel from '@material-ui/core/InputLabel';
const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
    },
    textField: {
      marginLeft: theme.spacing(5),
      marginRight: theme.spacing(2),
      width: '40ch',
    },
    pass: {
        marginLeft: theme.spacing(5),
      marginRight: theme.spacing(2),
      width: '38ch',
    },
    formControl: {
        marginLeft: theme.spacing(5),
        marginRight: theme.spacing(2),
        width: '24ch'
        
      },
      selectEmpty: {
        marginTop: theme.spacing(2),
      },
  })); 
class register extends React.Component {
  constructor(props){
    super(props);
  }
  render(){
              const classes = useStyles();
              const [values, setValues] = React.useState({
                  fname: '',
                  password: '',
                  pass2: '',
                  lname: '',
                  username: '',
                  email: '',
                  city: '',
                  mobile: '',
                  github: '',
                  linkedin: '',
                  showPassword: false,
                  showPassword2: false,
                  skill1: '',
                  skill2: '',
                  skill3: '',
                });
              
                const handleChange = (prop) => (event) => {
                  setValues({ ...values, [event.target.name]: event.target.value });
                };
              
                const handleClickShowPassword = () => {
                  setValues({ ...values, showPassword: !values.showPassword });
                };
                const jesse = () => {
                  setValues({ ...values, showPassword2: !values.showPassword2 });
                };
              
                const handleMouseDownPassword = (event) => {
                  event.preventDefault();
                };
                const mySubmitHandler = (event) =>{
                  alert("Welcome to the WorkShare Community!!");
              };
          return(<div className={classes.root}>
              
          <form autoComplete="off">
          <div className="middle"><h1><strong>Sign Up</strong></h1></div>
          <div>
          <TextField
                    label="First Name"
                    id="outlined-margin-dense"
                    defaultValue=""
                   placeholder="Enter Your First Name"
                    margin="dense"
                    variant="outlined"
                    name="fname"
                    className={classes.textField} 
                    color="primary"
                    onChange={handleChange()}
                    
                  />
                  <TextField
                    label="Last Name"
                    id="outlined-margin-dense"
                    defaultValue=""
                    name="lname"
                   placeholder="Enter Your Last Name"
                    margin="dense"
                    variant="outlined"
                    className={classes.textField}
                    onChange={handleChange()}
                    color="primary"
                  />
                  </div>
                  <div></div>
                  <div>
                  <TextField
                    label="Mobile No."
                    id="outlined-margin-dense"
                    defaultValue=""
                   placeholder="Enter Your Mobile No."
                    margin="dense"
                    name="mobile"
                    variant="outlined"
                    className={classes.textField}
                    onChange={handleChange()}
                    color="primary"
                  />
                  <TextField
                    label="Linkedin Link"
                    id="outlined-margin-dense"
                    defaultValue=""
                    name="linkedin"
                   placeholder="Enter Your Linkedin Link"
                    margin="dense"
                    variant="outlined"
                    className={classes.textField}
                    onChange={handleChange()}
                    color="primary"
                  />
                  </div>
                  <div></div>
                  <div>
                  <TextField
                    label="User Name"
                    id="outlined-margin-dense"
                    defaultValue=""
                   placeholder="Enter Your User Name"
                    margin="dense"
                    name="username"
                    variant="outlined"
                    className={classes.textField}
                    onChange={handleChange()}
                    color="primary"
                  />
                  <TextField
                    label="GitHub Link"
                    id="outlined-margin-dense"
                    defaultValue=""
                   placeholder="Enter Your Github Link"
                    margin="dense"
                    name="github"
                    variant="outlined"
                    className={classes.textField}
                    color="primary"
                    onChange={handleChange()}
                    
                  />
                  </div>
                  <div></div>
                  <div>
                  <TextField
                    label="City"
                    id="outlined-margin-dense"
                    defaultValue=""
                   placeholder="Enter Your City"
                    margin="dense"
                    name="city"
                    variant="outlined"
                    className={classes.textField}
                    onChange={handleChange()}
                    color="primary"
                  />
                  <TextField
                    label="Email"
                    id="outlined-margin-dense"
                    defaultValue=""
                   placeholder="Enter Your Email"
                    margin="dense"
                    name="email"
                    variant="outlined"
                    className={classes.textField}
                    onChange={handleChange()}
                    color="primary"
                  />
                  </div>
          <div></div>
          <div>
          <FormControl variant="outlined" className={classes.formControl}>
                  <InputLabel>Skill 1</InputLabel>
                  <Select
                    native
                    name="skill1"
                    
                    onChange={handleChange()}
                    label="Skills"
                    margin="dense"
                    color="primary"
                  >
                    <option aria-label="None" value="" />
                    <option value="Java">Java</option>
                    <option value="Python">Python</option>
                    <option value="Cpp">C++</option>
                    <option value="ML">Machine Learning</option>
                    <option value="AI">Artificial Intelligence</option>
                    <option value="WD">Web Development</option>
                  </Select>
                </FormControl>
                <FormControl variant="outlined" className={classes.formControl}>
                  <InputLabel>Skill 2</InputLabel>
                  <Select
                    native
                    name="skill2"
                    onChange={handleChange()}
                    label="Skills"
                    margin="dense"
                    color="primary"
                  >
                    <option aria-label="None" value="" />
                    <option value="Java">Java</option>
                    <option value="Python">Python</option>
                    <option value="Cpp">C++</option>
                    <option value="ML">Machine Learning</option>
                    <option value="AI">Artificial Intelligence</option>
                    <option value="WD">Web Development</option>
                  </Select>
                </FormControl>
                <FormControl variant="outlined" className={classes.formControl}>
                  <InputLabel>Skill 3</InputLabel>
                  <Select
                    native
                    name="skill3"
                    onChange={handleChange()}
                    label="Skills"
                    margin="dense"
                    color="primary"
                  >
                    <option aria-label="None" value="" />
                    <option value="Java">Java</option>
                    <option value="Python">Python</option>
                    <option value="Cpp">C++</option>
                    <option value="ML">Machine Learning</option>
                    <option value="AI">Artificial Intelligence</option>
                    <option value="WD">Web Development</option>
                  </Select>
                </FormControl>
               
          </div><div></div>
          <div>
          <FormControl variant="outlined">
                 
                    <OutlinedInput
                      type={values.showPassword ? 'text' : 'password'}
                      value={values.password}
                      color="primary"
                      margin="dense"
                      placeholder="Password"
                      className={classes.pass}
                      name="password"
                      onChange={handleChange()}
                      endAdornment={
                        <InputAdornment position="end">
                          <IconButton
                            aria-label="toggle password visibility"
                            onClick={handleClickShowPassword}
                            onMouseDown={handleMouseDownPassword}
                            edge="end"
                          >
                            {values.showPassword ? <Visibility /> : <VisibilityOff />}
                          </IconButton>
                        </InputAdornment>
                      }
                      labelWidth={70}
                    />
                    </FormControl>
                    <FormControl variant="outlined">
                   
                    <OutlinedInput
                      type={values.showPassword2 ? 'text' : 'password'}
                      value={values.pass2}
                      margin="dense"
                      color="primary"
                      placeholder="Confirm Password"
                      className={classes.pass}
                      name="pass2"
                      onChange={handleChange()}
                      endAdornment={
                        <InputAdornment position="end">
                          <IconButton
                            aria-label="toggle password visibility"
                            onClick={jesse}
                            onMouseDown={handleMouseDownPassword}
                            edge="end"
                          >
                            {values.showPassword2 ? <Visibility /> : <VisibilityOff />}
                          </IconButton>
                        </InputAdornment>
                      }
                      labelWidth={70}
                    />
                    </FormControl>
                 
          </div><div></div>

          <div></div>
          <div className="noob">
                      <Button variant="contained" color="primary" onClick={mySubmitHandler}>Submit</Button>
                  </div>
                 
          </form>
          </div>
    );
  }

}
